</head><body><h1>INES Mapper 146</h1><div class="article">
<p><b>iNES Mapper 146</b> is assigned to <i>Galactic Crusader</i> by Sachen according to NesCartDB.
</p><p>Nestopia implements it as a 100% duplicate of <a href="NINA_003_006.xhtml" title="NINA-003-006">NINA-06</a>. Санчез's notes seem to agree.
</p><p>Why was it allocated as a different mapper number? No-one knows.
